import { Icon, Button} from 'semantic-ui-react';


class Tags extends Component {

    constructor(props){
        super()
        this.state = {
            getTags: props.tags
        }
    }



    render(){
        console.log(this.state)
        return (
            <div>
                {this.state.getTags.map((tag, index) => {
                    return <Button>{tag} </Button>})}
            </div>

        )
    }
}

export default Tags 

